import React from 'react'
import { ListGroup ,ListGroupItem} from 'reactstrap'
import { BrowserRouter as Router,Routes, Route, Link } from 'react-router-dom';


function Menu(){
    return (
      <div className="">
       <div className="flex flex-col justify-center py-2 md:flex-row items-center text-white  bg-gray-700">
       
          <ul className="flex flex-col justify-center py-2 md:flex-row items-center text-white  bg-gray-700">
            <li className='text-xl py-3 mx-4 hover:scale-105 tec'><a href="/" >Home</a> </li>
            <li className='text-xl py-3 mx-4 hover:scale-105'><a href="/add-course">Home</a></li>
            <li className='text-xl py-3 mx-4 hover:scale-105'><a href="/view-courses">Home</a></li>
            <li className='text-xl py-3 mx-4 hover:scale-105'>Contact Us</li>
            <li className='text-xl py-3 mx-4 hover:scale-105'>About Us</li>
          </ul>
          
        </div>
      </div>
    ); 
}

export default Menu;
